version = "4.6.7"
source = { editable = "." }
dependencies = [
    { name = "django", extra = ["argon2"] },
    { name = "gunicorn" },
    { name = "hiredis" },
    { name = "opencv-python" },
    { name = "psycopg", extra = ["c", "pool"] },
    { name = "redis" },
    { name = "sentry-sdk" },
    { name = "tba-api-v3client" },
    { name = "wagtail" },
    { name = "whitenoise", extra = ["brotli"] },
]

[package.dev-dependencies]
dev = [
    { name = "black" },
    { name = "django-debug-toolbar" },
    { name = "django-types" },
    { name = "ipython" },
    { name = "rich" },
]
pre-commit = [
    { name = "add-trailing-comma" },
    { name = "djade" },
    { name = "django-upgrade" },
]

[package.metadata]
requires-dist = [
    { name = "django", extras = ["argon2"], specifier = ">=5.1.4" },
    { name = "gunicorn", specifier = ">=23.0.0" },
    { name = "hiredis", specifier = ">=3.1.0" },
    { name = "opencv-python", specifier = ">=4.10.0.84" },
    { name = "psycopg", extras = ["c", "pool"], specifier = ">=3.2.3" },
    { name = "redis", specifier = ">=5.2.1" },
    { name = "sentry-sdk", specifier = ">=2.19.2" },
    { name = "tba-api-v3client", specifier = ">=3.8.0" },
    { name = "wagtail", specifier = ">=6.4" },
    { name = "whitenoise", extras = ["brotli"], specifier = ">=6.8.2" },
]

[package.metadata.requires-dev]
dev = [
    { name = "black", specifier = ">=24.10.0" },
    { name = "django-debug-toolbar", specifier = ">=4.4.6" },
    { name = "django-types", specifier = ">=0.20.0" },
    { name = "ipython", specifier = ">=8.31.0" },
    { name = "rich", specifier = ">=13.9.4" },
]
pre-commit = [
    { name = "add-trailing-comma", specifier = ">=3.1.0" },
    { name = "djade", specifier = ">=1.3.2" },
    { name = "django-upgrade", specifier = ">=1.23.1" },
]

